import React from 'react'
import * as ROUTES from '../../constants/routes';
import { Link } from 'react-router-dom';

function Navbar() {
    return(
        <div className = "navbar">
            <ul>
                <li> 
                    <Link to = {ROUTES.MENU} >
                        <button> Menu </button>
                    </Link>
                </li>
                <li style = {{float: "right"}}> 
                <button> Look for </button> </li>
            </ul>
        </div>
    )
}

export default Navbar
